//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_COMPUTER_STATUS_FLAGS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e COMPUTER_STATUS_FLAGS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := COMPUTER_STATUS_FLAGS_UNDER_VOLTAGE.MarshalText()
		require.NoError(t, err)

		var dec COMPUTER_STATUS_FLAGS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, COMPUTER_STATUS_FLAGS_UNDER_VOLTAGE, dec)
	})
}
